class NextWorkerPool extends WorkerPool {

  constructor(...parameter) {
    super(...parameter)

    this._nextProcess = 0

  }

  selectProcess() {

    let process = null

    while (Is.null(process) || !process.process.isConnected) {
      process = this.getProcess(this._nextProcess++ % this.numberOfProcess)
    }

    return process

  }

}

